import React, {Component } from 'react';
import './footer.css';




class Footer extends Component {
    render() { 
        return ( 
            <div className="footer-container">
             <center>
                 <hr></hr>
              <p class="f11">We are leaders in 10 countries:
              <a href="#">Poland,</a>
              <a href="#">Turkey,</a>
              <a href="#">Spain,</a>
              <a href="#">Italy</a>
              <a href="#">Czech Republic,</a>
              <a href="#">Mexico,</a>
              <a href="#">Columbia,</a>
              <a href="#">Brazil,</a>
              <a href="#">Argentina,</a>and
              <a href="#">Chile</a>
                
                <p class="f11">This site uses cookies to deliver services in accordance with this Privacy Policy. You can specify the conditions for storing or accessing cookies on your browser.
                </p>

              <p class="f11">www.docplanner.com Â© 2018</p></p>
            </center>
           
           
                    
            </div>
         );
    }
  }
  
  
  
    export default Footer;
